package Basics1;

public class RelationalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//comparison operator == 
		//assignment operator =
		//relational operator 
		
		int a=20;
		int b=30;
		System.out.println(a==b);
		System.out.println(a=b);
		System.out.println(a>b);
		
		System.out.println(a<=b);
		
		System.out.println(a<b);
		
		System.out.println(a>=b);

	}

}
